                            FrontText = "What is the relationship between deep learning and representation learning?",
                            Interval = new TimeSpan(0, 0, 10, 0, 0),
                            Kind = 2,
                            RearText = "\"Unfortunately, learning representations is essentially as hard as the original stated problems. If we could learn when an image had windows, wheels, doors, hubcaps, or roads in them, it would be much more straightforward to know when they contain cars. This is because relevant concepts are only slightly shallower than the domain problem. Equivalently, conceptual knowledge is deep and stacked upon many prior concepts. Deep learning provides an idea, which is that the learned representation should be expressed in terms of simpler \"\"concepts\"\" (features). This feature stack is allowed to be deep when we measure the concept distance between the discriminating features and the raw input features.\"",
                            UpdatedAt = new DateTime(1, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified)
                        },
