                            DueAt = new DateTime(2020, 10, 10, 23, 1, 42, 849, DateTimeKind.Utc).AddTicks(3484),
                            Ease = 2.5f,
                            Engine = 2,
                            FrontText = "\"Deep learning is well and poorly named because \"\"deep\"\" is overloaded. What are three ways in which we mean deep?\"",
                            Interval = new TimeSpan(0, 0, 10, 0, 0),
                            Kind = 2,
                            RearText = "1. Sometimes people are being imprecise and are using deep learning to refer to deep neural networks, in which case depth is a formal concept expressing the path length through the network from input to output. 2. At a conceptual level, deep learning refers to learning a graph of concepts or features which embed data into a space where performing some task is straightforward. This is directly related to representation learning. 3. Deep is also meant to convey that the computation stack is deep. This is connected to the previous: computing high level features typically requires computing the lower level ones first.",
