                            Interval = new TimeSpan(0, 0, 10, 0, 0),
                            Kind = 2,
                            RearText = "\"A localist representation is one where a single learned feature is used to represent every single possible instantiation of a concept. This is as opposed to a distributed representation where there can be a many-to-many relationship between neurons and concepts. At a coarse level, distributed representations allow expressing adjectival phrases and conjunctions. I.e., there are concepts for \"\"red\"\" and concepts for \"\"car\"\" and each of these participate in expressing the concept of \"\"the redness of some cars\"\". In a distributed representation, each concept is represented by many local features and many local features participate in the representation of many concepts (many-to-many).\"",
