                            RearText = "In linear regression we assume that our data is parameterized by $p(y \\mid \\boldsymbol{x})=\\mathcal{N}\\left(y ; \\hat{y}(\\boldsymbol{x} ; \\boldsymbol{w}), \\sigma^{2}\\right)$ and we wish to produce a point estimator $\\hat{\\textbf{w}}$ of $w$. The MLE estimate is $\\begin{aligned}& \\sum_{i=1}^{m} \\log p\\left(y^{(i)} \\mid \\boldsymbol{x}^{(i)} ; \\boldsymbol{\\theta}\\right) \\\\=&-m \\log \\sigma-\\frac{m}{2} \\log (2 \\pi)-\\sum_{i=1}^{m} \\frac{\\left\\|\\hat{y}^{(i)}-y^{(i)}\\right\\|^{2}}{2 \\sigma^{2}}\\end{aligned}$",
