                            Ease = 2.5f,
                            Engine = 2,
                            FrontText = "If $\\textbf{x}=(\\textbf{x}_1,\\textbf{x}_2)$ is jointly Gaussian with $\\boldsymbol{\\mu}=\\left(\\begin{array}{l}\\boldsymbol{\\mu}_{1} \\\\\\boldsymbol{\\mu}_{2}\\end{array}\\right), \\quad \\boldsymbol{\\Sigma}=\\left(\\begin{array}{ll}\\boldsymbol{\\Sigma}_{11} & \\boldsymbol{\\Sigma}_{12} \\\\\\boldsymbol{\\Sigma}_{21} & \\boldsymbol{\\Sigma}_{22}\\end{array}\\right), \\boldsymbol{\\Lambda}=\\boldsymbol{\\Sigma}^{-1}=\\left(\\begin{array}{ll}\\boldsymbol{\\Lambda}_{11} & \\boldsymbol{\\Lambda}_{12} \\\\\\boldsymbol{\\Lambda}_{21} & \\boldsymbol{\\Lambda}_{22}\\end{array}\\right)$ then the marginal probabilities are {{c1::$\\begin{array}{l}p\\left(\\mathbf{x}_{1}\\right)=\\mathcal{N}\\left(\\mathbf{x}_{1} \\mid \\boldsymbol{\\mu}_{1}, \\mathbf{\\Sigma}_{11}\\right) \\\\p\\left(\\mathbf{x}_{2}\\right)=\\mathcal{N}\\left(\\mathbf{x}_{2} \\mid \\boldsymbol{\\mu}_{2}, \\mathbf{\\Sigma}_{22}\\right)\\end{array}$}} and the conditional probabilities are {{c2::$\\begin{aligned}p\\left(\\mathbf{x}_{1} \\mid \\mathbf{x}_{2}\\right) &=\\mathcal{N}\\left(\\mathbf{x}_{1} \\mid \\boldsymbol{\\mu}_{1 \\mid 2}, \\mathbf{\\Sigma}_{1 \\mid 2}\\right) \\\\\\boldsymbol{\\mu}_{1 \\mid 2} &=\\boldsymbol{\\mu}_{1}+\\boldsymbol{\\Sigma}_{12} \\boldsymbol{\\Sigma}_{22}^{-1}\\left(\\mathbf{x}_{2}-\\boldsymbol{\\mu}_{2}\\right) \\\\&=\\boldsymbol{\\mu}_{1}-\\boldsymbol{\\Lambda}_{11}^{-1} \\boldsymbol{\\Lambda}_{12}\\left(\\mathbf{x}_{2}-\\boldsymbol{\\mu}_{2}\\right) \\\\&=\\boldsymbol{\\Sigma}_{1 \\mid 2}\\left(\\boldsymbol{\\Lambda}_{11} \\boldsymbol{\\mu}_{1}-\\boldsymbol{\\Lambda}_{12}\\left(\\mathbf{x}_{2}-\\boldsymbol{\\mu}_{2}\\right)\\right) \\\\\\boldsymbol{\\Sigma}_{1 \\mid 2} &=\\boldsymbol{\\Sigma}_{11}-\\boldsymbol{\\Sigma}_{12} \\boldsymbol{\\Sigma}_{22}^{-1} \\boldsymbol{\\Sigma}_{21}=\\boldsymbol{\\Lambda}_{11}^{-1}\\end{aligned}$}}",
                            Interval = new TimeSpan(0, 0, 10, 0, 0),
                            Kind = 1,
                            RearText = "",
                            UpdatedAt = new DateTime(1, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified)
