                            Ease = 2.5f,
                            Engine = 2,
                            FrontText = "\"We can write a cost function as a loss over all the training data, mathematically, with parameters $\\boldsymbol{\\theta}$ this looks like {{c1::$J(\\boldsymbol{\\theta})=\\mathbb{E}_{(\\boldsymbol{x}, \\mathrm{y}) \\sim \\hat{p}_{\\text {data } } } L(f(\\boldsymbol{x} ; \\boldsymbol{\\theta}), y)$}} Because we are using the empirical distribution, this is an approximation to the \"\"true cost\"\" which is {{c1::$J^{*}(\\boldsymbol{\\theta})=\\mathbb{E}_{(\\boldsymbol{x}, y) \\sim p_{\\text {data } } } L(f(\\boldsymbol{x} ; \\boldsymbol{\\theta}), y)$}}\"",
                            Interval = new TimeSpan(0, 0, 10, 0, 0),
                            Kind = 1,
                            RearText = "",
                            UpdatedAt = new DateTime(1, 1, 1, 0, 0, 0, 0, DateTimeKind.Unspecified)
                        },
