                            DueAt = new DateTime(2020, 10, 10, 23, 1, 42, 886, DateTimeKind.Utc).AddTicks(427),
                            Ease = 2.5f,
                            Engine = 2,
                            FrontText = "In terms of optimizing the cost function, the difference between $\\hat{p}_{\\text {data } }$ and $p_{\\text {data } }$ is that {{c1::we do not have access to the true data generating distribution, and so we are not optimizing the true cost function but merely an approximation of it}}. This is related to a situation that can happen in deployment of models which is that {{c1::our model might perform poorly because our training dataset is not in accordance with the actual data distribution}}.",
